import Header from './Components/header/header'
import Banner from '../src/assets/images/Banner.png'

import './App.css';

function App() {
  return (
    <div>
        <Header/>
        <main>
          <div className="Banner">
            <img  src={Banner}></img>
            <div className="história">
                <h2>Venha fazer história conosco!</h2>
            </div>
          </div>
        </main>
    </div>   
  );
}

export default App;
